import React from 'react'
import parse from 'html-react-parser'
import resumeData from "../assets/resume.json"

const Resume = () => {
  const parseHtmlContent = (node) => {
    if (node.attribs && node.attribs.id === "profile-info") {
      return (
        <div className='info'>

        </div>
      )
    } else if (node.attribs && node.attribs.id === "name") {
      console.log(node.children[0]);
      return <p className='name'>{node.children[0].data}</p>
    }
  }

  return (
    <div className='resume'>
      { parse(resumeData.content, { replace: parseHtmlContent }) }
    </div>
  )
}

export default Resume
